        fontFamily: Typography.FONT_FAMILY_MEDIUM,
        fontWeight: Typography.FONT_WEIGHT_MEDIUM,
        fontSize: Typography.FONT_SIZE_16,
        fontSize: Typography.LINE_HEIGHT_24
    },
    h5: {
        fontFamily: Typography.FONT_FAMILY_MEDIUM,
        fontWeight: Typography.FONT_WEIGHT_MEDIUM,
        fontSize: Typography.FONT_SIZE_16,
        fontSize: Typography.LINE_HEIGHT_24
    },
    h6: {
        fontFamily: Typography.FONT_FAMILY_MEDIUM,
        fontWeight: Typography.FONT_WEIGHT_MEDIUM,
        fontSize: Typography.FONT_SIZE_16,
        fontSize: Typography.LINE_HEIGHT_24
    },
    paragraph:{
        fontFamily: Typography.FONT_FAMILY_MEDIUM,
        fontWeight: Typography.FONT_WEIGHT_MEDIUM,
        fontSize: Typography.FONT_SIZE_16,
        fontSize: Typography.LINE_HEIGHT_24
    }
};

const color = {
    background : Colors.WHITE
};

